webpackJsonp([41827939586149],{5050:function(e,t){e.exports={data:{post:{html:'<p>Both the Elbe tunnel and the A1 (Elbe bridges) are clogged. It\'s impossible to reach Hamburg from the south. My usual 45 minute commute took over 1 1/2 hours this morning!</p>\n<p>AP/Yahoo <a href="http://dailynews.yahoo.com/h/ap/20000313/tc/germany_infineon_4.html">Chip Maker Infineon\'s IPO Soars</a>:  "Shares in semiconductor maker Infineon Technologies AG soared Monday in Germany\'s largest IPO since Deutsche Telekom" Infineon fever in Germany... the issue was 33-fold oversubscribed. Thanks to the wonder of online banking, we already knew yesterday that we didn\'t get any shares.</p>\n<p><b>Tech Stuff</b></p>\n<p>Accidently discovered on the debian-devel mailing list: <a href="http://www.geocrawler.com/mail/msg.php3?msg_id=3427464&list=216">New LILO for >1024 cylinders</a> fixes a major annoyance with getting Linux to work on modern hard disks</p>',fields:{title:"Why are they doing road repair on both my routes to work?!?",date:"13 Mar 2000",url:"https://papascott.de/2000-03-13-why-are-they-doing-road-repair-on-both-my-routes-to-work/"}}},pathContext:{slug:"/2000-03-13-why-are-they-doing-road-repair-on-both-my-routes-to-work/",prev:{fields:{title:"Christopher at 11 Weeks",date:"12 Mar 2000",slug:"/2000-03-12-christopher-at-11-weeks/"}},next:{fields:{title:"Friday already?",date:"17 Mar 2000",slug:"/2000-03-17-friday-already/"}}}}}});
